    June 27, 2008, the two issues you questioned have been addressed.  Issue 1 refers
    to a $6,900 contribution on Schedule B with no corresponding entry on Schedule
    A.  This transaction was actually a test by our web maintenance company to make
    sure information was transmitting properly to our database.  This was not an actual
    contribution and has been deleted.  Issue 2, refers to $1,285 worth of contributions
    on Schedule A that does not appear on Schedule B. Schedule B has been corrected
    and appears to be a database error that has since been fixed."
